import React, { useState } from 'react';
import {Navbar,NavbarBrand,Nav,NavItem,Dropdown,DropdownToggle,DropdownMenu,DropdownItem,} from 'reactstrap';
import { useNavigate } from 'react-router-dom';

const Header = () => {
  let Profiler = 'https://static.vecteezy.com/system/resources/thumbnails/013/360/247/small/default-avatar-photo-icon-social-media-profile-sign-symbol-vector.jpg';
  let username = 'John Doe';
  let gender = 'Male';

  const [dropdownOpen, setDropdownOpen] = useState(false);


  const toggleDropdown = () => {
    setDropdownOpen((prevState) => !prevState);
  };

  let navigate = useNavigate();
  const ToHome = () => {
    navigate('/home');
  };
  const ToContact = () => {
    navigate('/contact');
  };
  const ToFeedback = () => {
    navigate('/feedback');
  };
  const ToHelp = () => {
    navigate("/help")
  }

  const handleSignOut = () => {
    navigate('/');
  };

  return (
    <Navbar className="navbar-h" expand="lg" fixed="top">
      <div className="container d-flex justify-content-between align-items-center">
        <div className="d-flex align-items-center gap-3">
          <div className="profile-image-container">
            <img
              className="profile-image"
              src={Profiler ? Profiler : 'https://static.vecteezy.com/system/resources/thumbnails/013/360/247/small/default-avatar-photo-icon-social-media-profile-sign-symbol-vector.jpg'}
              alt="profile"
              width="40px"
              height="40px"
            />
          </div>
          <NavbarBrand href="#">
            <h5 className="mb-0" onClick={() => navigate("/profile")}>
              {gender === 'Male' ? 'Mr.' : 'Ms.'} {username}
            </h5>
          </NavbarBrand>
        </div>
        <Nav className="d-flex align-items-center gap-2 text-white" navbar>
          <NavItem>
            <button className="button-no-color" onClick={ToHome}>
              Home
            </button>
          </NavItem>
          <NavItem>
            <button className="button-no-color" onClick={ToContact}>
              Contact us
            </button>
          </NavItem>
          <NavItem>
            <Dropdown isOpen={dropdownOpen} toggle={toggleDropdown}>
              <DropdownToggle nav caret className="button-no-color">
                More
              </DropdownToggle>
              <DropdownMenu>
                <DropdownItem header>Options</DropdownItem>
                <DropdownItem
                  className="bi-pencil-square"
                  onClick={ToFeedback}
                > &nbsp;
                   Feedback and Rating
                </DropdownItem>
                <DropdownItem
                  className="bi bi-question-circle"
                  onClick={ToHelp}
                > &nbsp;
                   Help
                </DropdownItem>
                <DropdownItem
                  className="bi bi-box-arrow-left"
                  onClick={handleSignOut}
                > &nbsp;
                   Sign Out
                </DropdownItem>
              </DropdownMenu>
            </Dropdown>
          </NavItem>
        </Nav>
      </div>
    </Navbar>

  );
};

export default Header;
